import React from 'react';

const MutualFollowersList = ({ mutualFollowers }) => {
  const handleClick = async (username) => {
    console.log(`Fetching repositories of mutual follower: ${username}`);
  };

  return (
    <div>
      <h3>Mutual Followers:</h3>
      <ul>
        {mutualFollowers.map((follower) => (
          <li key={follower.login} onClick={() => handleClick(follower.login)}>
            {follower.login}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default MutualFollowersList;
